import React from 'react';
import StockPopup from '../components/streams/StockPopup';
import { connect } from 'react-redux';
import { getStocks } from '../actions';
import stock from '../apis/stock';

{/* <Popup trigger={<button>Buy Stocks</button>} position="right center">
<StockPopup/>
</Popup> */}
class Deposits extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      date: [],
      open: [],
      high: [],
      low: [],
      close:[],
      adjustedclose:[],
      volume:[],
      divident:[],
      coefficient:[]

    };
  }    
  componentDidMount(){
    this.props.getStocks(this.props.currentCompany);
  }
  populateData(){
    let dateFunction= [];
     let openFunction= [];
      let highFunction= [];
      let lowFunction= [];
      let closeFunction=[];
      let adjustedcloseFunction=[];
      let volumeFunction=[];
      let dividentFunction=[];
      let coefficientFunction=[];

      for (var key in this.props.historics){
        dateFunction.push(key);
        openFunction.push("1. open");
        highFunction.push("2. high");
        lowFunction.push("3. low");
        closeFunction.push("4. close");
        adjustedcloseFunction.push("5. adjusted close");
        volumeFunction.push("6. volume");
        dividentFunction("7. dividend amount");
        coefficientFunction("8. split coefficien");
      }
  }


  render(){
    return (
        <div></div>
      );
  }
}

const mapStateToProps = (state) => {
  return {
    historics:state.stocks.companyInfo,
    currentCompany:state.stocks.currentCompany
  };
};

export default connect(
  mapStateToProps,
  { getStocks }
)(Deposits);
